export const SORTINGS = [
  /* default */ 'popularity.desc',
  'popularity.asc',
  'release_date.asc',
  'release_date.desc',
  'revenue.asc',
  'revenue.desc',
  'primary_release_date.asc',
  'primary_release_date.desc',
  'original_title.asc',
  'original_title.desc',
  'vote_average.asc',
  'vote_average.desc',
  'vote_count.asc',
  'vote_count.desc'
];

export const START_FETCHING = 'START_FETCHING';
export const SUCCESS_ACTION = 'SUCCESS_ACTION';
export const REJECT_ACTION = 'REJECT_ACTION';
